atom-workspace,
atom-text-editor {
  font-family: "Operator Mono";
  font-weight: 400;
  line-height: 1.5;
}
atom-panel.tool-panel {
  font-size: 1.1em;
}
.entity.other.attribute-name {
  font-style: italic;
}
atom-text-editor::shadow .entity.other.attribute-name {
  font-style: italic;
}
